import React, { useEffect } from "react";
import { connect } from "react-redux";
import { getThumbNails } from "../actions";
import css from "../css/storeGrid.css";

const StoreGrid = ({ getThumbNails, thumbNails }) => {
  useEffect(() => {
    getThumbNails();
    // eslint-disable-next-line
  }, []);

  const renderImages = () => {
    return thumbNails.map((photo) => {
      return (
        <div class='four wide column'>
          <img src={photo.image} alt={photo.image} key={photo.id} />
        </div>
      );
    });
  };

  return <div className='ui container grid'>{renderImages()}</div>;
};

const mapStateToProps = (state) => {
  return {
    thumbNails: state.thumbNails,
  };
};

export default connect(mapStateToProps, {
  getThumbNails,
})(StoreGrid);
